import * as React from "react";

import SearchBar from "./SearchBar";

import MusicVideo from "../util/MusicVideo";

import "../stylesheets/Navbar.css";

type NavbarProps = {
  videos: MusicVideo[];
};

export default function Navbar({ videos }: NavbarProps) {
  return (
    <div className="py-3 px-2 row align-items-center justify-content-center">
      <div className="col-3 row justify-content-start">
        <div className="col-4">
          <i className="fa fa-bars" aria-hidden="true"></i>
        </div>
        <div className="col-4">Spotify MTV</div>
      </div>
      <div className="col-6 d-flex justify-content-center">
        <SearchBar videos={videos} />
      </div>
      <div className="col-3"></div>
    </div>
  );
}
